import { REGISTER_USER} from "../constants/actionTypes";

const initialState = {
  profile: {
    name: "",
    userName: "",
    email: "",
    mobile: "",
    city: "",
    password: "",
    confirmPassword: "",
  },
};

const reducer = (state = initialState, action) => {
  switch (action.type) {
    case REGISTER_USER:
     let data = action.user
     console.log("Reducer Data ===>", data);
      return {
        ...state,
        profile: data,
      };
    default:
      return state;
  }
};

export default reducer;
